  false,\n\t\"url\": null,\n\t\"notes\": \"The following plan is the result of a U.S.
  Fish and Wildlife Service - Region Five initiative to produce general management
  guidance for individual field stations that is based on management objectives. Through
  this planning approach:1) the most important refuge issues are described and discussed,2)
  the current status, proposed actions, and program needs for the next five years
  are analyzed, and 3) refuge objectives and management strategies are developed by
  consensus of knowledgeable professionals.\",\n\t\"license_title\": \"License Not
